  Alessandra, d/o Thomas Russell Lowry and Jane de Gruchy. Address: "Oakbourne", RD 4,
  Waipukurau.
  Richard is a sheep, beef and grain farmer on "Oakbourne" station. He was educated at Wanganui
  Collegiate School and Lincoln College and has played rugby and polo for Hawkes Bay.
  Sana was educated at Rudolf Steiner School in Hastings (1974-77) and Woodford House, Havelock
  North (1978-82). She was junior athletics champion and was an under-18 hockey representative
  for Hawkes Bay for two years. In 1982 she was school photographer. She attended Waikato
  Polytechnic in 1984 and gained a Display and Advertising Certificate then worked as a
  photolettering typesetter for Churchword International Typefaces Ltd. She travelled and worked
  overseas in 1985-86 then worked as a picture framer in a New Zealand Art Gallery in 1987.
  Since her marriage she has continued picture framing in Waipukurau.
