  Mary Rutherford (niece of Lord Rutherford). Address: 4 Otupai Street, 2 Mile Bay, Taupo.
  John was educated at Hereworth School and Wanganui Collegiate School (Prefect, 1st rugby XV, 1st
  cricket XI). After completing a Dip Wool at Massey he attended London University and the London
  School of Economics, graduating BA(Econ) Cantab. He retired as Managing Director of the French
  wool-buying companies, Prouvost Lefebvre NZ Ltd and Compagnie d'Importation de Laines, the latter
  company as Australasian Managing Director based in Sydney.
